import Link from 'next/link';

const Banner = () => {
  return (
    <div className='jewelry-main-banner'>
      <div className='jewelry-banner-content'>
        <div className='line'></div>
        <span className='sub-title'>Holistic Lifestyle Co.</span>
        <p>Energetically</p>
        <p> Connected</p>
        <p>Either Directly</p>
        <p>Or Through A Conductor. </p>

        <h1>A grounded perspective.</h1>
        <Link href='/products?term=stickers'>
          <a className='default-btn'>Shop Now</a>
        </Link>
      </div>
    </div>
  );
};

export default Banner;
